    const row_data = [{"subplot_titles": ["Encoder weights (inst 0)", "Encoder weights (inst 1)", "Encoder weights (inst 2)", "Encoder weights (inst 3)", "Encoder weights (inst 4)", "Encoder weights (inst 5)", "Encoder weights (inst 6)", "Encoder weights (inst 7)"], "marker_size": 5, "line_width": 2, "batch_size": 5, "max_size": 1.6582652568817138, "tickmarks": [-1, 0, 1]}, {"subplot_titles": ["Decoder weights", "Decoder weights", "Decoder weights", "Decoder weights", "Decoder weights", "Decoder weights", "Decoder weights", "Decoder weights"], "marker_size": 5, "line_width": 2, "batch_size": 5, "max_size": 1.6582652568817138, "tickmarks": [-1, 0, 1]}];

            const g = plot.append("g")
                .attr("transform", axis.transform)
                .call(axis.scale.tickValues(index < 2 ? tickmarks : []).tickFormat(d3.format(".0f")).tickSize(0));
            g.selectAll("text")
                .attr("font-size", "13px")
                .attr(index === 0 ? "dy" : "dx", index === 0 ? "11px" : "-2px")
                .filter(index >= 2).remove();
        });

        plot.selectAll(".domain")
            .style("stroke-width", "2px");  // Set stroke width

    };

    const drawAllPlots = (time_idx) => {
        d3.range(n_plots).forEach(plot_idx => drawPlot(plot_idx, time_idx));
        
    var steps = [0, 100, 200, 300, 400, 500, 600, 700, 800, 900, 1000, 1100, 1200, 1300, 1400, 1500, 1600, 1700, 1800, 1900, 2000, 2100, 2200, 2300, 2400, 2500, 2600, 2700, 2800, 2900, 3000, 3100, 3200, 3300, 3400, 3500, 3600, 3700, 3800, 3900, 4000, 4100, 4200, 4300, 4400, 4500, 4600, 4700, 4800, 4900, 5000, 5100, 5200, 5300, 5400, 5500, 5600, 5700, 5800, 5900, 6000, 6100, 6200, 6300, 6400, 6500, 6600, 6700, 6800, 6900, 7000, 7100, 7200, 7300, 7400, 7500, 7600, 7700, 7800, 7900, 8000, 8100, 8200, 8300, 8400, 8500, 8600, 8700, 8800, 8900, 9000, 9100, 9200, 9300, 9400, 9500, 9600, 9700, 9800, 9900, 10000, 10100, 10200, 10300, 10400, 10500, 10600, 10700, 10800, 10900, 11000, 11100, 11200, 11300, 11400, 11500, 11600, 11700, 11800, 11900, 12000, 12100, 12200, 12300, 12400, 12500, 12600, 12700, 12800, 12900, 13000, 13100, 13200, 13300, 13400, 13500, 13600, 13700, 13800, 13900, 14000, 14100, 14200, 14300, 14400, 14500, 14600, 14700, 14800, 14900, 15000, 15100, 15200, 15300, 15400, 15500, 15600, 15700, 15800, 15900, 16000, 16100, 16200, 16300, 16400, 16500, 16600, 16700, 16800, 16900, 17000, 17100, 17200, 17300, 17400, 17500, 17600, 17700, 17800, 17900, 18000, 18100, 18200, 18300, 18400, 18500, 18600, 18700, 18800, 18900, 19000, 19100, 19200, 19300, 19400, 19500, 19600, 19700, 19800, 19900, 19999]
    d3.select('#title').html(`SAE on toy model, step ${steps[time_idx]} / ${steps[steps.length-1]}`);

    };

    drawAllPlots(0);

    let interval;
    let slider = d3.select('#slider');
    slider.on('input', function() { drawAllPlots(+this.value); });

    function togglePlayPause() {
        if (interval) {
            clearInterval(interval);
            interval = null;
        } else {
            let currentIndex = +slider.property('value');
            interval = setInterval(
                function() {
                    if (currentIndex < n_timesteps) {
                        slider.property('value', currentIndex);
                        drawAllPlots(currentIndex);
                        currentIndex++;  // Increment the index for the next iteration
                    } else {
                        clearInterval(interval);  // Stop the interval when reaching the end
                    }
                },
                20.0
            );
        }
    }

    function findConnectedPoints(d) {
        // When we hover over a point, all other points on different rows with the same instance are highlighted (with the
        // added filter that hovering over weights can only highlight other weights, and vice-versa for hidden activations)
        
        return d3.selectAll(".point")
            .filter(p => p.index === d.index && p.inst === d.inst && row_data[d.row].batch_size === row_data[p.row].batch_size)
    }

    function showTooltip(point, event) {
        const pointData = point.data()[0];
        const pointCoords = point.node().getBoundingClientRect();

        point.attr("fill", "red").attr("r", row_data[pointData.row].marker_size * 1.5);

        const tooltip = d3.select("body").append("div")
            .attr("class", "tooltip")
            .style("visibility", "visible")
            .html(`x: ${pointData.x.toFixed(4)}, y: ${pointData.y.toFixed(4)}`)
            .style("top", (window.scrollY + pointCoords.top - 10) + "px")
            .style("left", (window.scrollX + pointCoords.left + 20) + "px");
    }

    function hideTooltip(point) {
        const pointData = point.data()[0];

        point.attr("fill", (d, i) => getColor(d)).attr("r", row_data[pointData.row].marker_size);
        d3.selectAll(".tooltip").remove();
    }

    function getColor(d) {
        if (!('color' in d)) return 'black';
        
        if (d.color === 'red') return 'red';
        
        if (typeof d.color === 'number') {
            // Clamp the value between 0 and 1
            const value = Math.max(0, Math.min(1, d.color));
            // Convert to RGB where we're only increasing the red component
            return `rgb(${Math.round(value * 255)}, 0, 0)`;
        }
        
        return 'black';  // Default case for any other values
    }
</script>
